CREATE TABLE `punchings` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `date` date NOT NULL,
  `aadhaarid` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `designation` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `section` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `in_datetime` datetime DEFAULT NULL,
  `out_datetime` datetime DEFAULT NULL,
  `duration_sec` int DEFAULT NULL,
  `grace_sec` int DEFAULT NULL,
  `extra_sec` int DEFAULT NULL,
  `duration_str` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `grace_str` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `extra_str` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `punching_count` int DEFAULT NULL,
  `remarks` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `finalized_by_controller` int DEFAULT NULL,
  `ot_sitting_sec` int DEFAULT NULL,
  `ot_nonsitting_sec` int DEFAULT NULL,
  `hint` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `controller_set_punch_in` datetime DEFAULT NULL,
  `controller_set_punch_out` datetime DEFAULT NULL,
  `grace_total_exceeded_one_hour` int DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `employee_id` bigint unsigned DEFAULT NULL,
  `punchin_trace_id` bigint unsigned DEFAULT NULL,
  `punchout_trace_id` bigint unsigned DEFAULT NULL,
  `leave_id` bigint unsigned DEFAULT NULL,
  `computer_hint` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `single_punch_type` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `single_punch_regularised_by` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `time_group` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `is_unauthorised` tinyint(1) DEFAULT '0',
  `duration_sec_needed` int DEFAULT NULL,
  `flexi_time` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `punchings_date_aadhaarid_unique` (`date`,`aadhaarid`),
  KEY `employee_fk_9658128` (`employee_id`),
  KEY `punchin_trace_fk_9658818` (`punchin_trace_id`),
  KEY `punchout_trace_fk_9658820` (`punchout_trace_id`),
  KEY `leave_fk_9666917` (`leave_id`),
  CONSTRAINT `employee_fk_9658128` FOREIGN KEY (`employee_id`) REFERENCES `employees` (`id`),
  CONSTRAINT `leave_fk_9666917` FOREIGN KEY (`leave_id`) REFERENCES `leaves` (`id`),
  CONSTRAINT `punchin_trace_fk_9658818` FOREIGN KEY (`punchin_trace_id`) REFERENCES `punching_traces` (`id`),
  CONSTRAINT `punchout_trace_fk_9658820` FOREIGN KEY (`punchout_trace_id`) REFERENCES `punching_traces` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19605 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
